import React, { Component } from 'react'

export default class app extends Component {

  constructor() {
    super()
    this.state = {
      board: [
        [0, 0, 0],
        [0, 0, 0],
        [0, 0, 0]
      ]
    }
  }

  abc = ()=>{
    return <box value="oo"/>

  }


  render() {
    const { board } = this.state;
    console.log(board)
    return (
    <>
      {board.map((item,index) =>
      <div  key={index}>  
        {item}
        </div>  
      )}
    </>
    )
  }
}


function box(value) {
    return (
      <React.Fragment>
      <div>uihiu</div>
      </React.Fragment>
    )
}
